// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/token/ERC20/extensions/ERC20Burnable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts/proxy/utils/UUPSUpgradeable.sol";

/**
 * @title NexiumToken
 * @dev BEP-20 Token for Nexium ecosystem with upgradeable functionality
 */
contract NexiumToken is ERC20, ERC20Burnable, Ownable, Initializable, UUPSUpgradeable {
    // Total supply: 100 million tokens
    uint256 public constant INITIAL_SUPPLY = 100_000_000 * 10 ** 18;

    // Allocation percentages (from slides)
    mapping(bytes32 => uint256) public allocations;
    mapping(address => bool) public isMinted;

    event TokenAllocated(address indexed to, uint256 amount, string category);

    constructor() ERC20("Nexium", "NXM") Ownable(msg.sender) {}

    /**
     * @dev Initializer function for upgradeable contract
     */
    function initialize() public initializer onlyOwner {
        // Ecosystem Rewards - 35%
        allocations[keccak256(abi.encodePacked("ECOSYSTEM_REWARDS"))] = INITIAL_SUPPLY * 35 / 100;
        
        // Liquidity & Market Support - 20%
        allocations[keccak256(abi.encodePacked("LIQUIDITY_MARKET"))] = INITIAL_SUPPLY * 20 / 100;
        
        // Community & Network Growth - 15%
        allocations[keccak256(abi.encodePacked("COMMUNITY_GROWTH"))] = INITIAL_SUPPLY * 15 / 100;
        
        // Development & Operations - 15%
        allocations[keccak256(abi.encodePacked("DEV_OPERATIONS"))] = INITIAL_SUPPLY * 15 / 100;
        
        // Founders & Core Team - 10%
        allocations[keccak256(abi.encodePacked("FOUNDERS_TEAM"))] = INITIAL_SUPPLY * 10 / 100;
        
        // Reserve & Contingency - 5%
        allocations[keccak256(abi.encodePacked("RESERVE_CONTINGENCY"))] = INITIAL_SUPPLY * 5 / 100;
    }

    /**
     * @dev Mint tokens for ecosystem
     */
    function mintAllocation(address _to, string memory _category) external onlyOwner {
        bytes32 categoryKey = keccak256(abi.encodePacked(_category));
        require(allocations[categoryKey] > 0, "Invalid category or already minted");
        require(!isMinted[_to], "Address already received allocation");

        uint256 amount = allocations[categoryKey];
        isMinted[_to] = true;
        
        _mint(_to, amount);
        emit TokenAllocated(_to, amount, _category);
    }

    /**
     * @dev Mint tokens (only owner, for platform rewards)
     */
    function mint(address _to, uint256 _amount) external onlyOwner {
        _mint(_to, _amount);
    }

    /**
     * @dev Authorize an upgrade to a new implementation
     */
    function _authorizeUpgrade(address newImplementation) internal override onlyOwner {}

    /**
     * @dev Get contract version
     */
    function version() public pure returns (string memory) {
        return "1.0.0";
    }

    // BEP-20 standard name and symbol
    // Constructor handled above
}

contracts/PackageManager.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import "@openzeppelin/contracts/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts/proxy/utils/UUPSUpgradeable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

interface IPancakeRouter {
    function swapExactTokensForTokens(
        uint amountIn,
        uint amountOutMin,
        address[] calldata path,
        address to,
        uint deadline
    ) external returns (uint[] memory amounts);
}

/**
 * @title PackageManager
 * @dev Handles package purchases, multi-token support, and pool management
 */
contract PackageManager is Ownable, ReentrancyGuard, Initializable, UUPSUpgradeable {
    
    // Accepted payment tokens
    address public BUSD;
    address public USDT;
    address public USDC;
    address public NXM;
    address public WBNB;
    address public pancakeRouter;

    // Package structure
    struct Package {
        uint256 id;
        uint256 amount;
        uint256 dailyROI; // percentage (e.g., 40 = 0.4%)
        bool active;
    }

    // User package purchase
    struct UserPackage {
        uint256 packageId;
        uint256 amount;
        uint256 purchaseTime;
        uint256 earnings;
        uint256 maxEarnings; // 2x the amount
        bool active;
        uint256 topUpCount;
    }

    // Packages: I=$50, II=$100, III=$500, IV=$1000+
    Package[] public packages;
    
    // User purchases
    mapping(address => UserPackage[]) public userPackages;
    
    // Pool for owner withdrawals
    uint256 public totalPool;
    mapping(address => uint256) public poolContributions;

    // Events
    event PackagePurchased(address indexed user, uint256 packageId, uint256 amount, address paymentToken);
    event ROIEarned(address indexed user, uint256 amount);
    event PoolContributed(uint256 amount, address token);
    event ContractInitialized(address indexed busd, address indexed usdt, address indexed usdc);
    event PoolUpdated(uint256 totalPool, address token, uint256 amount);

    constructor() Ownable(msg.sender) {}

    /**
     * @dev Initialize contract with token addresses and packages
     */
    function initialize(
        address _busd,
        address _usdt,
        address _usdc,
        address _nxm,
        address _wbnb,
        address _pancakeRouter
    ) public initializer onlyOwner {
        require(_busd != address(0), "Invalid BUSD address");
        require(_usdt != address(0), "Invalid USDT address");
        require(_usdc != address(0), "Invalid USDC address");
        require(_nxm != address(0), "Invalid NXM address");
        require(_wbnb != address(0), "Invalid WBNB address");
        require(_pancakeRouter != address(0), "Invalid PancakeRouter address");

        BUSD = _busd;
        USDT = _usdt;
        USDC = _usdc;
        NXM = _nxm;
        WBNB = _wbnb;
        pancakeRouter = _pancakeRouter;

        // Initialize packages
        _initializePackages();
        
        emit ContractInitialized(_busd, _usdt, _usdc);
    }

    /**
     * @dev Initialize package tiers
     */
    function _initializePackages() private {
        packages.push(Package(0, 50 * 10**18, 40, true));      // $50, 0.4% daily
        packages.push(Package(1, 100 * 10**18, 60, true));     // $100, 0.6% daily
        packages.push(Package(2, 500 * 10**18, 75, true));     // $500, 0.75% daily
        packages.push(Package(3, 1000 * 10**18, 100, true));   // $1000+, 1% daily
    }

    /**
     * @dev Purchase package with BNB (main payment method)
     */
    function purchasePackageWithBNB(uint256 _packageId) external payable nonReentrant {
        require(_packageId < packages.length, "Invalid package");
        require(packages[_packageId].active, "Package not active");
        
        Package memory pkg = packages[_packageId];
        require(msg.value >= pkg.amount, "Insufficient BNB");

        // Record user package
        UserPackage memory userPkg = UserPackage(
            _packageId,
            msg.value,
            block.timestamp,
            0,
            msg.value * 2,  // max earnings = 2x
            true,
            0
        );

        userPackages[msg.sender].push(userPkg);
        
        // Add to pool (platform fee - 5% goes to pool)
        uint256 poolAmount = msg.value * 5 / 100;
        totalPool += poolAmount;
        poolContributions[address(0)] += poolAmount;

        emit PackagePurchased(msg.sender, _packageId, msg.value, address(0));
    }

    /**
     * @dev Purchase package with BUSD/USDT/USDC
     */
    function purchasePackageWithStableCoin(
        uint256 _packageId,
        uint256 _amount,
        address _token
    ) external nonReentrant {
        require(_packageId < packages.length, "Invalid package");
        require(packages[_packageId].active, "Package not active");
        require(_token == BUSD || _token == USDT || _token == USDC, "Token not supported");

        Package memory pkg = packages[_packageId];
        require(_amount >= pkg.amount, "Insufficient amount");

        // Transfer tokens from user to contract
        IERC20(_token).transferFrom(msg.sender, address(this), _amount);

        // Record user package
        UserPackage memory userPkg = UserPackage(
            _packageId,
            _amount,
            block.timestamp,
            0,
            _amount * 2,  // max earnings = 2x
            true,
            0
        );

        userPackages[msg.sender].push(userPkg);
        
        // Add to pool (5%)
        uint256 poolAmount = _amount * 5 / 100;
        totalPool += poolAmount;
        poolContributions[_token] += poolAmount;

        emit PackagePurchased(msg.sender, _packageId, _amount, _token);
    }

    /**
     * @dev Purchase package with NXM token
     */
    function purchasePackageWithNXM(uint256 _packageId, uint256 _amount) external nonReentrant {
        require(_packageId < packages.length, "Invalid package");
        require(packages[_packageId].active, "Package not active");

        Package memory pkg = packages[_packageId];
        require(_amount >= pkg.amount, "Insufficient amount");

        // Transfer NXM from user
        IERC20(NXM).transferFrom(msg.sender, address(this), _amount);

        // Record user package
        UserPackage memory userPkg = UserPackage(
            _packageId,
            _amount,
            block.timestamp,
            0,
            _amount * 2,
            true,
            0
        );

        userPackages[msg.sender].push(userPkg);
        
        // Add to pool (5%)
        uint256 poolAmount = _amount * 5 / 100;
        totalPool += poolAmount;
        poolContributions[NXM] += poolAmount;

        emit PackagePurchased(msg.sender, _packageId, _amount, NXM);
    }

    /**
     * @dev Get user's active packages
     */
    function getUserPackages(address _user) external view returns (UserPackage[] memory) {
        return userPackages[_user];
    }

    /**
     * @dev Get package details
     */
    function getPackage(uint256 _packageId) external view returns (Package memory) {
        require(_packageId < packages.length, "Invalid package");
        return packages[_packageId];
    }

    /**
     * @dev Owner withdraw from pool
     */
    function withdrawFromPool(address _token, uint256 _amount) external onlyOwner nonReentrant {
        require(_amount <= poolContributions[_token], "Insufficient pool balance");
        
        poolContributions[_token] -= _amount;
        totalPool -= _amount;

        if (_token == address(0)) {
            (bool success, ) = owner().call{value: _amount}("");
            require(success, "Transfer failed");
        } else {
            IERC20(_token).transfer(owner(), _amount);
        }
    }

    /**
     * @dev Authorize upgrade
     */
    function _authorizeUpgrade(address newImplementation) internal override onlyOwner {}
}

contracts/PoolManager.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import "@openzeppelin/contracts/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts/proxy/utils/UUPSUpgradeable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

/**
 * @title PoolManager
 * @dev Manages platform pool for owner withdrawals and fund management
 */
contract PoolManager is Ownable, ReentrancyGuard, Initializable, UUPSUpgradeable {
    
    // Supported tokens
    address public BUSD;
    address public USDT;
    address public USDC;
    address public NXM;

    // Pool balances by token
    mapping(address => uint256) public poolBalances;
    
    // BNB balance (address(0) represents BNB)
    uint256 public bnbBalance;

    // Withdrawal tracking
    struct Withdrawal {
        address token;
        uint256 amount;
        uint256 timestamp;
        address recipient;
    }

    Withdrawal[] public withdrawalHistory;

    // Events
    event FundsDeposited(address indexed token, uint256 amount);
    event FundsWithdrawn(address indexed token, uint256 amount, address indexed recipient);
    event EmergencyWithdrawal(address indexed token, uint256 amount);
    event ContractInitialized(address indexed busd, address indexed usdt, address indexed usdc);
    event PoolBalanceUpdated(address indexed token, uint256 newBalance);

    constructor() Ownable(msg.sender) {}

    /**
     * @dev Initialize pool manager
     */
    function initialize(
        address _busd,
        address _usdt,
        address _usdc,
        address _nxm
    ) public initializer onlyOwner {
        require(_busd != address(0), "Invalid BUSD address");
        require(_usdt != address(0), "Invalid USDT address");
        require(_usdc != address(0), "Invalid USDC address");
        require(_nxm != address(0), "Invalid NXM address");
        
        BUSD = _busd;
        USDT = _usdt;
        USDC = _usdc;
        NXM = _nxm;
        
        emit ContractInitialized(_busd, _usdt, _usdc);
    }

    /**
     * @dev Deposit BNB to pool
     */
    receive() external payable {
        bnbBalance += msg.value;
        emit FundsDeposited(address(0), msg.value);
    }

    /**
     * @dev Deposit tokens to pool
     */
    function depositTokens(address _token, uint256 _amount) external onlyOwner {
        require(_token != address(0), "Invalid token");
        require(_amount > 0, "Invalid amount");

        IERC20(_token).transferFrom(msg.sender, address(this), _amount);
        poolBalances[_token] += _amount;

        emit FundsDeposited(_token, _amount);
        emit PoolBalanceUpdated(_token, poolBalances[_token]);
    }

    /**
     * @dev Owner withdraws BNB from pool
     */
    function withdrawBNB(uint256 _amount) external onlyOwner nonReentrant {
        require(_amount <= bnbBalance, "Insufficient BNB balance");
        
        bnbBalance -= _amount;

        // Record withdrawal
        withdrawalHistory.push(Withdrawal(
            address(0),
            _amount,
            block.timestamp,
            msg.sender
        ));

        (bool success, ) = owner().call{value: _amount}("");
        require(success, "BNB transfer failed");

        emit FundsWithdrawn(address(0), _amount, owner());
    }

    /**
     * @dev Owner withdraws tokens from pool
     */
    function withdrawTokens(address _token, uint256 _amount) external onlyOwner nonReentrant {
        require(_amount <= poolBalances[_token], "Insufficient token balance");
        
        poolBalances[_token] -= _amount;

        // Record withdrawal
        withdrawalHistory.push(Withdrawal(
            _token,
            _amount,
            block.timestamp,
            msg.sender
        ));

        require(IERC20(_token).transfer(owner(), _amount), "Token transfer failed");

        emit FundsWithdrawn(_token, _amount, owner());
    }

    /**
     * @dev Emergency withdrawal (owner only)
     */
    function emergencyWithdraw(address _token) external onlyOwner nonReentrant {
        if (_token == address(0)) {
            // Withdraw all BNB
            uint256 balance = address(this).balance;
            bnbBalance = 0;
            
            (bool success, ) = owner().call{value: balance}("");
            require(success, "Emergency BNB withdrawal failed");
            
            emit EmergencyWithdrawal(address(0), balance);
        } else {
            // Withdraw all tokens
            uint256 balance = IERC20(_token).balanceOf(address(this));
            poolBalances[_token] = 0;
            
            require(IERC20(_token).transfer(owner(), balance), "Emergency token withdrawal failed");
            
            emit EmergencyWithdrawal(_token, balance);
        }
    }

    /**
     * @dev Get pool balance for a token
     */
    function getPoolBalance(address _token) external view returns (uint256) {
        if (_token == address(0)) {
            return bnbBalance;
        }
        return poolBalances[_token];
    }

    /**
     * @dev Get withdrawal history
     */
    function getWithdrawalHistory() external view returns (Withdrawal[] memory) {
        return withdrawalHistory;
    }

    /**
     * @dev Get total pool value (in various tokens)
     */
    function getTotalPoolValue() external view returns (
        uint256 bnb,
        uint256 busd,
        uint256 usdt,
        uint256 usdc,
        uint256 nxm
    ) {
        return (
            bnbBalance,
            poolBalances[BUSD],
            poolBalances[USDT],
            poolBalances[USDC],
            poolBalances[NXM]
        );
    }

    /**
     * @dev Authorize upgrade
     */
    function _authorizeUpgrade(address newImplementation) internal override onlyOwner {}
}

