// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import "@openzeppelin/contracts/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts/proxy/utils/UUPSUpgradeable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

/**
 * @title ReferralManager
 * @dev Manages binary referral tree and matching bonuses (5%)
 */
contract ReferralManager is Ownable, ReentrancyGuard, Initializable, UUPSUpgradeable {
    
    address public NXM;

    // Binary tree node structure
    struct ReferralNode {
        address referrer;
        address leftChild;
        address rightChild;
        uint256 leftSubtreeSize;
        uint256 rightSubtreeSize;
        uint256 matchingBonus;
        uint256 pairsMatched;
        bool exists;
    }

    // User referral data
    struct UserReferral {
        address[] directReferrals;
        uint256 totalMatchingBonus;
        uint256 totalDirectBonus;
        uint256 pendingBonus;
    }

    mapping(address => ReferralNode) public referralTree;
    mapping(address => UserReferral) public userReferrals;
    mapping(address => uint256) public bonusBalance;

    uint256 public constant MATCHING_BONUS_PERCENT = 500; // 5% = 500/10000
    uint256 public constant DIRECT_BONUS_PERCENT = 1000;  // 10% = 1000/10000

    uint256 public totalBonusPaidOut;

    // Events
    event ReferralRegistered(address indexed referrer, address indexed referee);
    event MatchingBonusGenerated(address indexed user, uint256 amount);
    event DirectBonusGenerated(address indexed user, uint256 amount);
    event BonusWithdrawn(address indexed user, uint256 amount);
    event ContractInitialized(address indexed nxmToken);
    event BinaryTreeUpdated(address indexed parent, address indexed child, bool isLeftChild);

    constructor() Ownable(msg.sender) {}

    /**
     * @dev Initialize referral manager
     */
    function initialize(address _nxm) public initializer onlyOwner {
        require(_nxm != address(0), "Invalid NXM token address");
        NXM = _nxm;
        emit ContractInitialized(_nxm);
    }

    /**
     * @dev Register a new referral (user joins with referrer)
     */
    function registerReferral(address _referrer, address _user) external onlyOwner {
        require(_referrer != address(0), "Invalid referrer");
        require(_user != address(0), "Invalid user");
        require(_referrer != _user, "Cannot refer yourself");
        require(!referralTree[_user].exists, "User already registered");
        require(referralTree[_referrer].exists || _referrer == owner(), "Referrer not registered");

        // Create referral node
        referralTree[_user].referrer = _referrer;
        referralTree[_user].exists = true;

        // Add to referrer's direct referrals
        userReferrals[_referrer].directReferrals.push(_user);

        // Place in binary tree
        _placeInBinaryTree(_referrer, _user);

        emit ReferralRegistered(_referrer, _user);
    }

    /**
     * @dev Place user in referrer's binary tree
     */
    function _placeInBinaryTree(address _referrer, address _user) private {
        ReferralNode storage referrerNode = referralTree[_referrer];

        // Place in left or right subtree based on size
        if (referrerNode.leftSubtreeSize <= referrerNode.rightSubtreeSize) {
            // Place in left
            if (referrerNode.leftChild == address(0)) {
                referrerNode.leftChild = _user;
                referrerNode.leftSubtreeSize = 1;
            } else {
                _placeInBinaryTree(referrerNode.leftChild, _user);
                referrerNode.leftSubtreeSize++;
            }
        } else {
            // Place in right
            if (referrerNode.rightChild == address(0)) {
                referrerNode.rightChild = _user;
                referrerNode.rightSubtreeSize = 1;
            } else {
                _placeInBinaryTree(referrerNode.rightChild, _user);
                referrerNode.rightSubtreeSize++;
            }
        }
    }

    /**
     * @dev Generate matching bonus (when both left and right have activity)
     */
    function generateMatchingBonus(address _user, uint256 _packageAmount) public onlyOwner {
        require(referralTree[_user].exists, "User not registered");

        ReferralNode storage node = referralTree[_user];

        // Check if both left and right children have activity
        if (node.leftChild != address(0) && node.rightChild != address(0)) {
            // Calculate 5% matching bonus
            uint256 bonusAmount = (_packageAmount * MATCHING_BONUS_PERCENT) / 10000;

            node.matchingBonus += bonusAmount;
            node.pairsMatched++;
            bonusBalance[_user] += bonusAmount;

            emit MatchingBonusGenerated(_user, bonusAmount);

            // Recursively give bonus to referrer
            if (node.referrer != address(0)) {
                generateMatchingBonus(node.referrer, _packageAmount);
            }
        }
    }

    /**
     * @dev Generate direct referral bonus (10%)
     */
    function generateDirectBonus(address _referrer, uint256 _packageAmount) external onlyOwner {
        require(referralTree[_referrer].exists, "Referrer not registered");

        // Calculate 10% direct bonus
        uint256 bonusAmount = (_packageAmount * DIRECT_BONUS_PERCENT) / 10000;

        userReferrals[_referrer].totalDirectBonus += bonusAmount;
        bonusBalance[_referrer] += bonusAmount;

        emit DirectBonusGenerated(_referrer, bonusAmount);
    }

    /**
     * @dev Withdraw bonus balance (automatic payout to wallet)
     */
    function withdrawBonus(uint256 _amount) external nonReentrant {
        require(_amount <= bonusBalance[msg.sender], "Insufficient bonus balance");

        bonusBalance[msg.sender] -= _amount;
        totalBonusPaidOut += _amount;

        // Transfer NXM to user wallet
        require(IERC20(NXM).transfer(msg.sender, _amount), "Transfer failed");

        emit BonusWithdrawn(msg.sender, _amount);
    }

    /**
     * @dev Get user's referral info
     */
    function getUserReferralInfo(address _user) external view returns (
        ReferralNode memory node,
        UserReferral memory referral,
        uint256 bonusBalance_
    ) {
        return (referralTree[_user], userReferrals[_user], bonusBalance[_user]);
    }

    /**
     * @dev Get direct referrals of a user
     */
    function getDirectReferrals(address _user) external view returns (address[] memory) {
        return userReferrals[_user].directReferrals;
    }

    /**
     * @dev Check if user is registered
     */
    function isRegistered(address _user) external view returns (bool) {
        return referralTree[_user].exists;
    }

    /**
     * @dev Get matching bonus info
     */
    function getMatchingBonusInfo(address _user) external view returns (uint256 total, uint256 pairs) {
        return (referralTree[_user].matchingBonus, referralTree[_user].pairsMatched);
    }

    /**
     * @dev Authorize upgrade
     */
    function _authorizeUpgrade(address newImplementation) internal override onlyOwner {}
}

contracts/RewardLevels.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import "@openzeppelin/contracts/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts/proxy/utils/UUPSUpgradeable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

interface IReferralManager {
    function referralTree(address _user) external view returns (
        address referrer,
        address leftChild,
        address rightChild,
        uint256 leftSubtreeSize,
        uint256 rightSubtreeSize,
        uint256 matchingBonus,
        uint256 pairsMatched,
        bool exists
    );
}

/**
 * @title RewardLevels
 * @dev Manages progressive reward levels (10 levels from Starter Node to Genesis Node)
 */
contract RewardLevels is Ownable, ReentrancyGuard, Initializable, UUPSUpgradeable {
    
    address public NXM;
    IReferralManager public referralManager;

    // Reward level structure (from slides)
    struct RewardLevel {
        uint256 id;
        string rankTitle;
        uint256 requiredPairs;
        string rewardType;
        uint256 cashReward;
        uint256 nxmReward;
        string additionalBenefits;
        bool active;
    }

    // User level tracking
    struct UserLevel {
        uint256 currentLevel;
        uint256 pairsAchieved;
        uint256 totalRewardsClaimed;
        uint256 lastLevelUpTime;
        bool[] levelsClaimed;
    }

    // All 10 reward levels
    RewardLevel[] public rewardLevels;
    
    mapping(address => UserLevel) public userLevels;
    mapping(address => bool) public isShowcaseUser;

    uint256 public totalRewardsPaid;

    // Events
    event LevelUnlocked(address indexed user, uint256 level, string rankTitle);
    event RewardClaimed(address indexed user, uint256 level, uint256 cashReward, uint256 nxmReward);
    event ShowcaseUserSet(address indexed user, uint256 level);
    event ContractInitialized(address indexed nxm, address indexed referralManager);
    event UserLevelUpdated(address indexed user, uint256 newLevel, uint256 pairsAchieved);

    constructor() Ownable(msg.sender) {}

    /**
     * @dev Initialize reward levels
     */
    function initialize(address _nxm, address _referralManager) public initializer onlyOwner {
        require(_nxm != address(0), "Invalid NXM token address");
        require(_referralManager != address(0), "Invalid ReferralManager address");
        
        NXM = _nxm;
        referralManager = IReferralManager(_referralManager);
        _initializeRewardLevels();
        
        emit ContractInitialized(_nxm, _referralManager);
    }

    /**
     * @dev Initialize all 10 reward levels from slides
     */
    function _initializeRewardLevels() private {
        // Level 1: Starter Node - 25 Pairs
        rewardLevels.push(RewardLevel(
            1,
            "Starter Node",
            25,
            "Cash + Token",
            100 * 10**18,  // $100 cash
            50 * 10**18,   // 50 NXM
            "Basic platform access",
            true
        ));

        // Level 2: Growth Node - 50 Pairs
        rewardLevels.push(RewardLevel(
            2,
            "Growth Node",
            50,
            "Cash + Token",
            250 * 10**18,  // $250 cash
            200 * 10**18,  // 200 NXM
            "Priority support",
            true
        ));

        // Level 3: Power Node - 100 Pairs
        rewardLevels.push(RewardLevel(
            3,
            "Power Node",
            100,
            "Cash + Token",
            500 * 10**18,  // $500 cash
            300 * 10**18,  // 300 NXM
            "Enhanced benefits",
            true
        ));

        // Level 4: Elite Node - 250 Pairs
        rewardLevels.push(RewardLevel(
            4,
            "Elite Node",
            250,
            "Cash + Token",
            1000 * 10**18,  // $1000 cash
            600 * 10**18,   // 600 NXM
            "VIP access",
            true
        ));

        // Level 5: Pro Node - 500 Pairs
        rewardLevels.push(RewardLevel(
            5,
            "Pro Node",
            500,
            "Lifestyle + Crypto",
            1500 * 10**18,  // $1500 cash
            0,
            "MacBook or Travel Voucher",
            true
        ));

        // Level 6: Prime Node - 1000 Pairs
        rewardLevels.push(RewardLevel(
            6,
            "Prime Node",
            1000,
            "Cash + International Summit",
            2500 * 10**18,  // $2500 cash
            0,
            "Business Summit Invitation",
            true
        ));

        // Level 7: Wealth Node - 2500 Pairs
        rewardLevels.push(RewardLevel(
            7,
            "Wealth Node",
            2500,
            "Lifestyle Reward 2",
            15000 * 10**18,  // $15000 cash
            0,
            "Gas OR Premium Car Down Payment",
            true
        ));

        // Level 8: Titan Node - 5000 Pairs
        rewardLevels.push(RewardLevel(
            8,
            "Titan Node",
            5000,
            "Long-Term Income",
            50000 * 10**18,  // $50000 cash
            0,
            "Lifetime 0.20% ROI Boost",
            true
        ));

        // Level 9: Legend Node - 10000 Pairs
        rewardLevels.push(RewardLevel(
            9,
            "Legend Node",
            10000,
            "Equity-Style Benefit",
            0,
            0,
            "0.5% Share of Monthly Platform Revenue",
            true
        ));

        // Level 10: Genesis Node - 25000 Pairs
        rewardLevels.push(RewardLevel(
            10,
            "Genesis Node",
            25000,
            "Founder-Class Reward",
            100000 * 10**18,  // $100000 cash
            0,
            "Advisory Status",
            true
        ));
    }

    /**
     * @dev Check and update user level based on referral pairs
     */
    function updateUserLevel(address _user) public {
        // Get user's pairs from referral manager
        (, , , , , , uint256 pairsMatched, ) = referralManager.referralTree(_user);
        
        UserLevel storage userLevel = userLevels[_user];
        userLevel.pairsAchieved = pairsMatched;

        // Check if user qualifies for higher levels
        for (uint256 i = userLevel.currentLevel; i < rewardLevels.length; i++) {
            if (pairsMatched >= rewardLevels[i].requiredPairs) {
                if (userLevel.currentLevel < i + 1) {
                    userLevel.currentLevel = i + 1;
                    userLevel.lastLevelUpTime = block.timestamp;
                    
                    // Initialize level claimed array
                    if (userLevel.levelsClaimed.length == 0) {
                        userLevel.levelsClaimed = new bool[](rewardLevels.length);
                    }

                    emit LevelUnlocked(_user, i + 1, rewardLevels[i].rankTitle);
                }
            }
        }
    }

    /**
     * @dev Claim reward for achieved level
     */
    function claimLevelReward(uint256 _level) external nonReentrant {
        require(_level > 0 && _level <= rewardLevels.length, "Invalid level");
        
        UserLevel storage userLevel = userLevels[msg.sender];
        require(userLevel.currentLevel >= _level, "Level not achieved");
        require(!userLevel.levelsClaimed[_level - 1], "Reward already claimed");

        // Mark as claimed
        userLevel.levelsClaimed[_level - 1] = true;

        RewardLevel memory level = rewardLevels[_level - 1];

        // Transfer cash reward (in stablecoin/BNB)
        if (level.cashReward > 0) {
            // Transfer cash reward to user
            userLevel.totalRewardsClaimed += level.cashReward;
            totalRewardsPaid += level.cashReward;
        }

        // Transfer NXM reward
        if (level.nxmReward > 0) {
            require(IERC20(NXM).transfer(msg.sender, level.nxmReward), "NXM transfer failed");
            userLevel.totalRewardsClaimed += level.nxmReward;
            totalRewardsPaid += level.nxmReward;
        }

        emit RewardClaimed(msg.sender, _level, level.cashReward, level.nxmReward);
    }

    /**
     * @dev Set showcase user (for display purposes)
     */
    function setShowcaseUser(address _user, uint256 _level) external onlyOwner {
        require(_level > 0 && _level <= rewardLevels.length, "Invalid level");
        
        isShowcaseUser[_user] = true;
        
        UserLevel storage userLevel = userLevels[_user];
        userLevel.currentLevel = _level;
        userLevel.pairsAchieved = rewardLevels[_level - 1].requiredPairs;
        userLevel.lastLevelUpTime = block.timestamp;

        emit ShowcaseUserSet(_user, _level);
    }

    /**
     * @dev Get user level info
     */
    function getUserLevelInfo(address _user) external view returns (
        uint256 currentLevel,
        string memory rankTitle,
        uint256 pairsAchieved,
        uint256 nextLevelPairs,
        uint256 totalRewardsClaimed
    ) {
        UserLevel memory userLevel = userLevels[_user];
        
        currentLevel = userLevel.currentLevel;
        pairsAchieved = userLevel.pairsAchieved;
        totalRewardsClaimed = userLevel.totalRewardsClaimed;

        if (currentLevel > 0 && currentLevel <= rewardLevels.length) {
            rankTitle = rewardLevels[currentLevel - 1].rankTitle;
        } else {
            rankTitle = "No Rank";
        }

        if (currentLevel < rewardLevels.length) {
            nextLevelPairs = rewardLevels[currentLevel].requiredPairs;
        } else {
            nextLevelPairs = 0; // Max level reached
        }
    }

    /**
     * @dev Get all reward levels
     */
    function getAllRewardLevels() external view returns (RewardLevel[] memory) {
        return rewardLevels;
    }

    /**
     * @dev Get specific reward level
     */
    function getRewardLevel(uint256 _level) external view returns (RewardLevel memory) {
        require(_level > 0 && _level <= rewardLevels.length, "Invalid level");
        return rewardLevels[_level - 1];
    }

    /**
     * @dev Check if user can claim level reward
     */
    function canClaimReward(address _user, uint256 _level) external view returns (bool) {
        if (_level == 0 || _level > rewardLevels.length) return false;
        
        UserLevel memory userLevel = userLevels[_user];
        if (userLevel.currentLevel < _level) return false;
        if (userLevel.levelsClaimed.length > 0 && userLevel.levelsClaimed[_level - 1]) return false;

        return true;
    }

    /**
     * @dev Authorize upgrade
     */
    function _authorizeUpgrade(address newImplementation) internal override onlyOwner {}
}

contracts/ROIManager.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import "@openzeppelin/contracts/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts/proxy/utils/UUPSUpgradeable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

interface IPackageManager {
    struct UserPackage {
        uint256 packageId;
        uint256 amount;
        uint256 purchaseTime;
        uint256 earnings;
        uint256 maxEarnings;
        bool active;
        uint256 topUpCount;
    }
    
    function userPackages(address _user, uint256 _index) external view returns (UserPackage memory);
    function getUserPackages(address _user) external view returns (UserPackage[] memory);
}

/**
 * @title ROIManager
 * @dev Calculates and automatically pays daily ROI to users
 */
contract ROIManager is Ownable, ReentrancyGuard, Initializable, UUPSUpgradeable {
    
    IPackageManager public packageManager;
    address public NXM;
    
    // ROI tracking per user package
    struct ROIRecord {
        address user;
        uint256 packageIndex;
        uint256 lastClaimTime;
        uint256 totalPaidOut;
        bool active;
    }

    mapping(address => mapping(uint256 => ROIRecord)) public roiRecords;
    mapping(address => uint256) public pendingROI;

    // Daily ROI percentages based on package (from slides)
    mapping(uint256 => uint256) public dailyROIPercentages; // packageId => percentage (40 = 0.4%)

    uint256 public withdrawnROI;
    
    // Events
    event ROIPaidOut(address indexed user, uint256 amount, uint256 packageIndex);
    event ROIAccumulated(address indexed user, uint256 amount);
    event ROICalculated(address indexed user, uint256 dailyAmount, uint256 packageIndex);
    event ContractInitialized(address indexed packageManager, address indexed nxmToken);
    event ROIPercentageUpdated(uint256 indexed packageId, uint256 newPercentage);

    constructor() Ownable(msg.sender) {}

    /**
     * @dev Initialize ROI manager
     */
    function initialize(address _packageManager, address _nxm) public initializer onlyOwner {
        require(_packageManager != address(0), "Invalid PackageManager address");
        require(_nxm != address(0), "Invalid NXM token address");
        
        packageManager = IPackageManager(_packageManager);
        NXM = _nxm;

        // Set daily ROI percentages
        dailyROIPercentages[0] = 40;   // Package 1: 0.4%
        dailyROIPercentages[1] = 60;   // Package 2: 0.6%
        dailyROIPercentages[2] = 75;   // Package 3: 0.75%
        dailyROIPercentages[3] = 100;  // Package 4: 1%
        
        emit ContractInitialized(_packageManager, _nxm);
    }

    /**
     * @dev Calculate pending ROI for a user's package
     */
    function calculatePendingROI(address _user, uint256 _packageIndex) public view returns (uint256) {
        IPackageManager.UserPackage[] memory packages = packageManager.getUserPackages(_user);
        require(_packageIndex < packages.length, "Invalid package index");

        IPackageManager.UserPackage memory pkg = packages[_packageIndex];
        require(pkg.active, "Package not active");

        // Package already earned 2x amount
        if (pkg.earnings >= pkg.maxEarnings) {
            return 0;
        }

        // Get time elapsed since last claim
        ROIRecord memory record = roiRecords[_user][_packageIndex];
        uint256 timeSinceLastClaim = record.lastClaimTime > 0 
            ? block.timestamp - record.lastClaimTime 
            : block.timestamp - pkg.purchaseTime;

        // Calculate ROI in days (1 day = 86400 seconds)
        uint256 daysElapsed = timeSinceLastClaim / 86400;
        
        if (daysElapsed == 0) {
            return 0;
        }

        // Get daily ROI percentage
        uint256 dailyPercent = dailyROIPercentages[pkg.packageId];
        
        // Calculate ROI: amount * (percentage / 10000) * days
        uint256 roiAmount = (pkg.amount * dailyPercent / 10000) * daysElapsed;

        // Check if ROI would exceed max earnings
        uint256 remainingEarnings = pkg.maxEarnings - pkg.earnings;
        
        return roiAmount > remainingEarnings ? remainingEarnings : roiAmount;
    }

    /**
     * @dev Claim pending ROI for a package (automatic payout to wallet)
     */
    function claimROI(uint256 _packageIndex) external nonReentrant {
        uint256 roiAmount = calculatePendingROI(msg.sender, _packageIndex);
        require(roiAmount > 0, "No pending ROI");

        // Update ROI record
        roiRecords[msg.sender][_packageIndex].lastClaimTime = block.timestamp;
        roiRecords[msg.sender][_packageIndex].totalPaidOut += roiAmount;
        
        // Add to pending withdrawal (will be paid automatically)
        pendingROI[msg.sender] += roiAmount;

        emit ROIAccumulated(msg.sender, roiAmount);
    }

    /**
     * @dev Withdraw accumulated ROI (automatic payout to wallet)
     */
    function withdrawROI(uint256 _amount) external nonReentrant {
        require(_amount <= pendingROI[msg.sender], "Insufficient ROI balance");
        
        pendingROI[msg.sender] -= _amount;
        withdrawnROI += _amount;

        // Transfer NXM tokens to user wallet
        require(IERC20(NXM).transfer(msg.sender, _amount), "Transfer failed");

        emit ROIPaidOut(msg.sender, _amount, 0);
    }

    /**
     * @dev Automatic daily ROI payout (can be called by backend service)
     */
    function automaticDailyROI(address _user, uint256[] calldata _packageIndexes) external onlyOwner {
        for (uint256 i = 0; i < _packageIndexes.length; i++) {
            uint256 roiAmount = calculatePendingROI(_user, _packageIndexes[i]);
            if (roiAmount > 0) {
                roiRecords[_user][_packageIndexes[i]].lastClaimTime = block.timestamp;
                roiRecords[_user][_packageIndexes[i]].totalPaidOut += roiAmount;
                pendingROI[_user] += roiAmount;

                // Emit event for tracking
                emit ROICalculated(_user, roiAmount, _packageIndexes[i]);
            }
        }

        // Auto-transfer to user wallet
        if (pendingROI[_user] > 0) {
            uint256 amount = pendingROI[_user];
            pendingROI[_user] = 0;
            require(IERC20(NXM).transfer(_user, amount), "Auto-transfer failed");
            withdrawnROI += amount;
        }
    }

    /**
     * @dev Get user's pending ROI balance
     */
    function getPendingROI(address _user) external view returns (uint256) {
        return pendingROI[_user];
    }

    /**
     * @dev Get ROI record for a package
     */
    function getROIRecord(address _user, uint256 _packageIndex) external view returns (ROIRecord memory) {
        return roiRecords[_user][_packageIndex];
    }

    /**
